    "orbview-3-level-1b84183",nt"isopen": false,nt"url": null,nt"notes":
    "GeoEye's OrbView-3 satellite was among the world's first commercial satellites
    to provide high-resolution imagery from space. OrbView-3 collected one meter panchromatic
    (black and white) and four meter multispectral (color) imagery at a swath width
    of 8 km for both sensors. One meter imagery enables more accurate viewing and mapping
    of houses, automobiles and aircraft, and makes it possible to create precise digital
    products. Four meter multispectral imagery provides color and near infrared (NIR)
    information to further characterize cities, rural areas and undeveloped land from
    space. Imagery from the OrbView-3 satellite complements existing geographic information
    system (GIS) data for commercial, environmental and national security customers.
    OrbView-3 orbits 470 km above the Earth in a sun-synchronous polar orbit while collecting
    imagery of the Earth's surface at one meter resolution in the Panchromatic (black
    and white) mode, or at four meter resolution in the Multispectral (color) mode with
    a three day repeat cycle. The U.S. Geological Survey (USGS) Earth Resources Observation
    and Science (EROS) Center received 179,981 OrbView-3 image segments from GeoEye
    with no restrictions. The data were delivered in Basic Enhanced (Level 1B) radiometrically
    corrected format. The product files include satellite telemetry data, rational functions,
    post-processed Ground Sample Distance (GPS) at nadir data, and sufficient metadata
    for rigorous triangulation. The data in this collection were acquired between September
    2003 and March 2007, both multispectral (MS) and panchromatic (Pan) sensor.",nt"license_title":
